                        {
                            Id = 1944,
                            About = "Kouga Yun (real name: Yamada Risa, 山田理沙, née Kimura) is a Japanese mangaka, born on July 9, 1965 in Shinagawa-ku, Tokyo, Japan. Her blood type is B, and she is married to fellow mangaka Tatsuneko. She is a graduate of Mita Senior High School, Tokyo. She currently lives in Setagaya-ku, Tokyo, and also has a daughter.\n\nShe began her career as a doujinshi artist creating doujinshi for works such as Saint Seiya, Captain Tsubasa and Maouden.\n\nShe debuted in a commercial magazine with the original work Metal Heart (serialised in Kobunsha's Comic VAL from November 1986). After her debut, she continued to contribute on numerous doujin works. However, the later disbanding of a doujin circle, Yajou Teikoku, she had founded with Maki Chikura, led to her taking numerous breaks from her commercial works. Due to this, there were incomplete works penned by her during this period.\n\nDuring her years in middle school, she had been a fan of Masami Kurumada's manga series Ring ni Kakero, Fuuma no Kojirou, Saint Seiya and B't X (serialised in Weekly Shounen Jump), sending Kurumada numerous fan letters asking to meet him, after which Kurumada finally agreed, inviting her to his workplace.\n\nWhen asked about her penname in an interview in the September 2006 issue of Puff, she responded that she had originally thought of making it Kouga Jun, but subsequently changed it to Kouga Yun.\n\nAmong her noted works is Loveless, which has been serialised in Monthly Comic Zero Sum since 2002 and is ongoing, as well as her work Tenshichou (天使庁). She has also worked as an illustrator on the noted literary magazine Faust.\n\nIn 2007, she contributed the character designs to the Sunrise anime series, Mobile Suit Gundam 00.\n\n(Source: AniDB)\n\nTwitter: @yunk99\nBlog: http://yunkouga.jugem.jp/",
