                            About = "Gen Urobuchi is a Japanese novelist, visual novel writer and anime screenwriter. He is best known for writing the highly acclaimed and commercially successful anime series Madoka Magica, which earned him the Tokyo Anime Award for Best Scriptwriter. Some other of his popular works include the 2003 visual novel Saya no Uta, the 2012 anime Psycho-Pass, the light novel and anime Fate/Zero, and the 2013–2014 tokusatsu show Kamen Rider Gaim. He currently works at Nitroplus and Nitro+chiral. \n\nNicknamed Urobutcher by his fans, Urobuchi's works often contain dark and nihilistic themes, tragic plot twists, and heavy usage of gore. Anime written by Urobuchi that have won the Newtype Anime Award have been Puella Magi Madoka Magica in 2011, Fate/Zero in 2012 and Psycho-Pass: The Movie in 2015. \n\nHe wrote scenarios for several visual novels created by Nitroplus:\nPhantom of Inferno (2000)\nKyuuketsu Senki Vjedogonia (2001)\nKikokugai: The Cyber Slayer (2002).\nSaya no Uta (2003)\nZoku Satsuriku no Django ~Jigoku no Shoukinkubi~ (2007)\n\n(Source: Wikipedia)\n\nTwitter: @Butch_Gen",
