                        new
                        {
                            Id = 3776,
                            About = "Real name is unknown.\n\nShiina Takashi is a Japanese manga artist who writes primarily for the weekly Shogakukan manga publication Weekly Shounen Sunday. When he started at the company in 1989, he began with an anthology of various shorts and one-shots collectively known as Shiina Department Store. Eventually one of these one-shots, about a beautiful, money grubbing female exorcist and her lecherous companion, would become the basis of his most well know work: Ghost Sweeper Mikami: Gokuraku Daisakusen!! (more well known by its shorter name: Ghost Sweeper Mikami, or GS Mikami) Running from 1991 through 1999, it became well known and popular work in Sunday, even leading to an anime of the series from 1993 through 1994 by Toei Animation as well as a Shogakukan Manga Award for shounen in 1993. Even as he had success with Mikami, Shiina continued to create various one-shot stories on the side of his main series.\n\nAfter the end of GS Mikami, Shiina tried to create new series for the manga anthology, such as Ichiban-yu no Kanata and Mister Japan. He also created new series and shorts on the side, including GS Holmes: Gokuraku Daisakusen!! (an alternate take on Sherlock Holmes co-starring the robotic Maria from GS Mikami) In 2003, Shiina introduced another of his many ideas in Shounen Sunday in short form: Zettai Karen Children, about three young girls with great psychic powers and terrifying ambitions. Finding some success with it in short form, the mangaka introduced it as a weekly series in 2005, where it continues to run at this time.\n\nBlog: http://cnanews.asablo.jp/blog/\n\nPictured with voice actress Ootake Miyu.\n\n(Source: AniDB)\n\nTwitter: @Takashi_Shiina",
