            modelBuilder.Entity("AnimeDbWebApp.Models.Producer", b =>
                {
                    b.Property<int>("Id")
                        .ValueGeneratedOnAdd()
                        .HasColumnType("int")
                        .HasComment("Unique Identifier");

                    SqlServerPropertyBuilderExtensions.UseIdentityColumn(b.Property<int>("Id"));

                    b.Property<string>("About")
                        .HasColumnType("nvarchar(max)")
                        .HasComment("Information about producer");

                    b.Property<DateTime?>("Established")
                        .HasColumnType("DATETIME2")
                        .HasComment("Date the studio is established");

                    b.Property<string>("ImgUrl")
                        .HasMaxLength(500)
                        .HasColumnType("nvarchar(500)")
                        .HasComment("Anime poster url");

                    b.Property<string>("JpName")
                        .HasMaxLength(50)
                        .HasColumnType("nvarchar(50)")
                        .HasComment("Japanese name of the studio");

                    b.Property<string>("Name")
                        .IsRequired()
                        .HasMaxLength(50)
                        .HasColumnType("nvarchar(50)")
                        .HasComment("English name of the studio");

                    b.Property<string>("Url")
                        .HasMaxLength(500)
                        .HasColumnType("nvarchar(500)")
                        .HasComment("Url link to mal site of producer");

                    b.HasKey("Id");

                    b.ToTable("Producers");

                    b.HasData(
                        new
                        {
                            Id = 1,
                            About = "Pierrot ぴえろ (Pierrot Co., Ltd.) is a Japanese animation studio established in May 1979 by former employees of both Tatsunoko Production and Mushi Production. Its headquarters are located in Mitaka, Tokyo. Pierrot is renowned for several worldwide popular anime series, such as Naruto, Bleach, Yu Yu Hakusho, Black Clover, Boruto: Naruto Next Generations, Tokyo Ghoul, and Great Teacher Onizuka.",
                            Established = new DateTime(1979, 4, 30, 17, 0, 0, 0, DateTimeKind.Local),
                            ImgUrl = "https://cdn.myanimelist.net/s/common/company_logos/a0524dfa-5a6d-40a7-8a1e-233e3822acb5_600x600_i?s=48123c150ab3365033f471461a50acc6",
                            JpName = "ぴえろ",
                            Name = "Pierrot",
                            Url = "https://myanimelist.net/anime/producer/1/Pierrot"
                        },
                        new
                        {
                            Id = 2,
                            About = "Kyoto Animation (Kyoto Animation Co., Ltd.) (often abbreviated KyoAni) is a Japanese animation studio based in Uji, Kyoto Prefecture. Youko Hatta (born Youko Sugiyama), who had previously studied under Osamu Tezuka as an artist at Mushi Production, founded the company with her husband, Hideaki Hatta, in 1981. Kyoto Animation spent its early years doing finishing work for other companies' productions, but opened its own drawing department in 1986, the year following its establishment as a limited company. \n\nBy the mid-90s, the company had developed a strong reputation in the industry, as well as ties to studios such as Gonzo, Shin-Ei Animation, and Sunrise. Kyoto Animation released its first full in-house production—the first Munto OVA—in March 2003, and its first television anime, Full Metal Panic? Fumoffu, in the summer of the same year. \n\nThe company gained worldwide attention on July 18, 2019 when an arson attack destroyed its original studio (known as Studio 1) in Fushimi, claiming the lives of 36 people.",
                            Established = new DateTime(1985, 7, 11, 17, 0, 0, 0, DateTimeKind.Local),
                            ImgUrl = "https://cdn.myanimelist.net/s/common/company_logos/b066ff17-81d3-40db-b1f2-2927de70c0e3_600x600_i?s=edb149cf051e2d7984975063a1b3b3a7",
                            JpName = "京都アニメーション",
                            Name = "Kyoto Animation",
                            Url = "https://myanimelist.net/anime/producer/2/Kyoto_Animation"
                        },
                        new
                        {
                            Id = 3,
                            About = "Gonzo is a Japanese anime studio. In 2002, a merger of Gonzo and Digimation took place, creating the new company Gonzo Digimation. In 2004, the company was renamed back to Gonzo.\n\nIn June 2006, the company signed a long-term output deal with the anime television network, Animax, which resulted in Animax broadcasting all of Gonzo's anime titles across all of its networks around the world, including Japan, Asia, the Indian subcontinent, Latin America and since November 2007 on Southern Africa's DSTV satellite network. In 2008, they decided to stream some of their airing anime on video sites such as YouTube, Crunchyroll, and BOST.\n\nThe studio had a financial problem in their closing account in 2008-2009 term and stated its deficit was estimated over 30 million dollars. As a result, Gonzo was absorbed into its parent company, GDH, and had its management and facilities restructured. On 2009-04-01, the merger was completed, and GDH was renamed as Gonzo.\n\n(Source: Wikipedia)",
                            Established = new DateTime(2000, 2, 28, 16, 0, 0, 0, DateTimeKind.Local),
                            ImgUrl = "https://cdn.myanimelist.net/s/common/company_logos/8d25fb54-5111-4174-9bee-46298c25adbd_600x600_i?s=1adca46b4f789fd450089b1912573235",
                            JpName = "ゴンゾ",
                            Name = "Gonzo",
                            Url = "https://myanimelist.net/anime/producer/3/Gonzo"
                        },
                        new
                        {
                            Id = 4,
                            About = "Bones (Bones Inc.) is a Japanese animation studio based in Suginami, Tokyo. The studio was founded by previous Sunrise producer Masahiko Minami and animators Hiroshi Ousaka and Toshihiro Kawamoto in 1998. Following Sunrise's production model, Bones' founders divided the company into five smaller studios, Studio A-E. \n\nStudio Bones has put out a variety of television and film since its debut project of Hiwou War Chronicles in 2000, including popular anime such as Ouran Koukou Host Club (Ouran High School Host Club), Hagane no Renkinjutsushi: Fullmetal Alchemist (Fullmetal Alchemist: Brotherhood), Boku no Hero Academia (My Hero Academia), and Bungou Stray Dogs",
                            Established = new DateTime(1998, 9, 30, 17, 0, 0, 0, DateTimeKind.Local),
                            ImgUrl = "https://cdn.myanimelist.net/s/common/company_logos/969047f0-a8ec-475e-ad0d-6e0d5cd8e17f_600x600_i?s=4145bdb95a29f3fe1447baa8045a7420",
