                            Id = 28,
                            About = "OLM (OLM, Inc.), formerly known as Oriental Light &amp; Magic (Oriental Light &amp; Magic, Inc.) prior to June of 1994, is a Japanese animation and production studio based in Setagaya, Tokyo, Japan. Former Gallop and OB Planning employees led by Toshiaki Okuno, Shuukichi Kanda, Shouji Oota, Kunihiko Yuyama, Naohito Takahashi, Yuriko Chiba, Nobuyuki Wasaki, Tsukasa Koitabashi, and Takaya Mizutani established OLM as Oriental Light &amp; Magic (Oriental Light &amp; Magic, Inc.) on October 3, 1990. Since its establishment, OLM now has various subsidiaries — OLM Digital, Inc. (April, 1997); OLM MUSIC, Inc. (June, 2012); OLM Ventures Inc. (June, 2017); OLM Asia SDN BHD (December, 2017); Viracocha Inc. (March, 1997); and Sprite Entertainment, Inc. (May, 2002) — which encompasses the OLM Group. Since April 2016, OLM has been a majority-owned subsidiary of IMAGICA Group.\n\nAs of 2023, the studio is divided into six-production teams: OLM TEAM INOUE, comprised of former employees from TEAM WASAKI led by Takashi Inoue; OLM TEAM KATO, comprised of former employees from TEAM OTA, TEAM IGUCHI, TEAM IWASA, and TEAM KAMEI led by Hiroyuki Kato; OLM TEAM YOSHIOKA, comprised of former employees from TEAM IWASA and TEAM WASAKI led by Daisuke Yoshioka; OLM TEAM MASUDA, led by former MAPPA producer Katsudo Masuda; OLM TEAM ABE, led by former SynergySP producer Isamu Abe; and OLM TEAM MIIKE, a division of OLM Digital which produces live-action works under the direction of Takashi Miike led by Misako Saka.",
