                            About = "Seven Arcs (Seven Arcs Co., Ltd.) is a Japanese animation studio based in Musashino, Tokyo, Japan. Seven Arcs Co., Ltd. was established in October 2019 through the merger of Arcturus, Seven Arcs, and Seven Arcs Pictures (Seven Arcs Group) — with Seven Arcs Pictures as the surviving company. Since 2018, the studio has been a wholly-owned subsidiary of TBS Holdings.\n\nThe former Seven Arcs Co., Ltd. was established on May 31, 2002, as a subsidiary of Arcturus, which itself was founded by former Pierrot director — Osamu Kamimura — in April 2000. In April 2012, Seven Arcs Pictures Co., Ltd. was established through an incorporation-type company split from Seven Arcs’ animation production business. Since then, the companies tied to Arcturus — Seven Arcs and Seven Arcs Pictures — comprised the Seven Arcs Group until October 2019.",
